        {name : 'The Americas' , img : './imges/north-america.jpg'},
        {name : 'Asia' , img : './imges/asia.jpg'},
        {name : 'Europe' , img : './imges/Europe.jpg'},
        {name : 'Australia' , img : './imges/Australia.jpg'},
        {name : 'Antarctica - Oceania' , img : './imges/Antarctica.jpg'},


    ]
    return(
        <div cl>
            {continents.map(con=>{
                return(
                    <div className="card">
                        <h3>{con.name}</h3>
                        <img src={con.img} alt='map' width='200px'/>
                    </div>
                )
            })}
        </div>
    )
}

export default Continents
